select count(*), region_type
from ref_geo_regions
group by region_type;


SELECT gr.region_type,
       gr.region

FROM ref_geo_regions gr
WHERE ST_Contains(boundary, ST_GeometryFromText('GEOMETRYCOLLECTION(POINT(51.49227 -0.30864))', 4326));


create index mat_view_regions_region_type_index
    on mat_view_regions (region_type);


show full processlist;


select (select exceedance
        from (select cume_dist() OVER w * 100.0   as exceedance,
                     rhs.period                   as period,
                     IFNULL(lhs.count, rhs.count) as count
              from (SELECT count(source_id)                                                 as count,
                           floor((1634054247 - unix_timestamp(t.source_timestamp)) / 86400) as period

                    FROM live_text t
                             left join
                         ref_geo_regions gr on ST_Contains(boundary, location)
                    WHERE gr.region = regions.region
                      and gr.region_type = 'uk_country'
                      and t.hazard = 'flood'
                      and t.source = 'twitter'
                      and not warning
                      and not t.deleted
                    group by period
                    order by period
                   ) lhs
                       RIGHT OUTER JOIN (select value as period, 0 as count from ref_integers where value < 700) rhs
                                        ON lhs.period = rhs.period
                  WINDOW w AS (ORDER BY IFNULL(lhs.count, rhs.count) desc)) x
        where period = 0
          and count > 0) as exceedance,
       (SELECT count(*) as count
        FROM live_text t
                 left join
             ref_geo_regions gr on ST_Contains(boundary, location)
        WHERE gr.region = regions.region
          and gr.region_type = 'uk_country'
          and t.hazard = 'flood'
          and t.source = 'twitter'
          and not warning
          and not t.deleted
          and t.source_timestamp between NOW() - INTERVAL 1 DAY and NOW()
       )                 as count,
       regions.region    as region

from (select distinct region from ref_geo_regions where region_type = 'uk_country') as regions;

create index ref_geo_regions_title_index
    on ref_geo_regions (title);
update ref_geo_regions
set title=tcase(region)
where title is null
  and not region REGEXP '^[0-9]+$'
order by title;

select tcase('aberdeen city');

alter table ref_geo_regions
    add level int default 0 not null;

update ref_geo_regions
set level =1
where region_type = 'nuts1';
update ref_geo_regions
set level =2
where region_type = 'uk_country';
update ref_geo_regions
set level =3
where region_type = 'iso_country';

